-- ----------------------------
-- Table structure for `agent`
-- ----------------------------
DROP TABLE IF EXISTS `agent`;
CREATE TABLE `agent` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL COMMENT '代理商名称',
  `number` varchar(20) NOT NULL COMMENT '代理商编号',
  `contract_date` date NOT NULL COMMENT '签约日期',
  `province_id` int(10) unsigned NOT NULL COMMENT '省ID',
  `city_id` int(10) unsigned NOT NULL COMMENT '市ID',
  `county_id` int(10) unsigned NOT NULL COMMENT '县ID',
  `status` tinyint(3) unsigned NOT NULL COMMENT '状态，1正常，2停用',
  `contacts` varchar(30) NOT NULL COMMENT '联系人',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '联系电话',
  `mailbox` varchar(30) NOT NULL COMMENT '联系邮箱',
  `menu_ids` text COMMENT '菜单ID',
  `min_cashback` decimal(10,2) unsigned NOT NULL DEFAULT '100.00' COMMENT '最小提现金额(返现)',
  `cashback_fee` decimal(10,2) unsigned NOT NULL DEFAULT '2.00' COMMENT '提现手续费(返现)',
  `cash_fee` decimal(10,2) unsigned NOT NULL DEFAULT '2.00' COMMENT '提现手续费(分润)',
  `min_cash_amount` decimal(10,2) unsigned NOT NULL DEFAULT '100.00' COMMENT '最小提现金额(分润)',
  `tax_point` decimal(10,2) unsigned NOT NULL DEFAULT '5.00' COMMENT '提现税点(分润)',
  `address` varchar(200) NOT NULL COMMENT '联系地址',
  `created_at` int(10) unsigned NOT NULL,
  `updated_at` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `number` (`number`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COMMENT='代理商信息表';

-- ----------------------------
-- Records of agent
-- ----------------------------

