DROP TABLE IF EXISTS `agent_user`;
CREATE TABLE `agent_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `agent_id` int(10) unsigned NOT NULL COMMENT '机构名称',
  `add_user_name` varchar(20) NOT NULL COMMENT '添加人,快照',
  `account` varchar(32) NOT NULL COMMENT '登录帐号',
  `user_name` varchar(32) NOT NULL COMMENT '用户名',
  `number` varchar(20) NOT NULL DEFAULT '' COMMENT '工号',
  `mobile` varchar(20) NOT NULL COMMENT '手机号码',
  `login_IP` varchar(30) NOT NULL DEFAULT '',
  `mailbox` varchar(64) NOT NULL DEFAULT '' COMMENT '联系邮箱',
  `login_time` int(10) unsigned DEFAULT NULL COMMENT '登录时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态，1正常，2停用',
  `auth_key` char(64) NOT NULL DEFAULT '',
  `password_hash` varchar(500) NOT NULL DEFAULT '',
  `root` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '超级管理人员，1是，0否',
  `remarks` varchar(500) NOT NULL DEFAULT '' COMMENT '备注',
  `created_at` int(10) unsigned NOT NULL,
  `updated_at` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `account` (`account`),
  UNIQUE KEY `auth_key` (`auth_key`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4;

