-- Table structure for `sys_manager`
-- ----------------------------
DROP TABLE IF EXISTS `sys_manager`;
CREATE TABLE `sys_manager` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(20) NOT NULL DEFAULT '' COMMENT '帐号',
  `password_hash` varchar(150) NOT NULL DEFAULT '' COMMENT '密码',
  `auth_key` varchar(32) NOT NULL DEFAULT '' COMMENT '授权令牌',
  `password_reset_token` varchar(150) DEFAULT '' COMMENT '密码重置令牌',
  `type` tinyint(1) DEFAULT '1' COMMENT '1:普通管理员;10超级管理员',
  `realname` varchar(10) DEFAULT '' COMMENT '真实姓名',
  `head_portrait` char(150) DEFAULT '' COMMENT '头像',
  `gender` tinyint(1) unsigned DEFAULT '0' COMMENT '性别[0:未知;1:男;2:女]',
  `qq` varchar(20) DEFAULT '' COMMENT 'qq',
  `email` varchar(60) DEFAULT '' COMMENT '邮箱',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `provinces` int(11) DEFAULT '0' COMMENT '省',
  `city` int(11) DEFAULT '0' COMMENT '城市',
  `area` int(11) DEFAULT '0' COMMENT '地区',
  `address` varchar(100) DEFAULT '' COMMENT '默认地址',
  `mobile` varchar(20) DEFAULT '' COMMENT '手机号码',
  `home_phone` varchar(20) DEFAULT '' COMMENT '家庭号码',
  `visit_count` smallint(5) unsigned DEFAULT '0' COMMENT '访问次数',
  `last_time` int(10) DEFAULT '0' COMMENT '最后一次登陆时间',
  `last_ip` varchar(16) DEFAULT '' COMMENT '最后一次登陆ip',
  `role` smallint(6) DEFAULT '10' COMMENT '权限',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态[-1:删除;0:禁用;1启用]',
  `created_at` int(11) unsigned NOT NULL COMMENT '创建时间',
  `updated_at` int(11) unsigned DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COMMENT='系统_后台管理员表';

