DROP TABLE IF EXISTS `sys_notify`;
CREATE TABLE `sys_notify` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(150) DEFAULT '' COMMENT '标题',
